import React from "react"
import {
    Typography,
    Button,
    Container,
    Grid
} from "@material-ui/core"
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
      height: 50,
      background: white,
    },
  }));

export const Header = () => {
    const classes = useStyles();
    return (
        <div className = {classes.root}>
            <Grid container>
                <Grid item xs = {5} className = "header_title">
                    <Typography>
                        Filebox
                    </Typography>
                </Grid>
                <Grid item xs = {5} className = "header_logout">
                    <Button>
                        Signout
                    </Button>
                </Grid>
            </Grid>
        </div>
    )
}
